import React from 'react'
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { faPen, faTrashCan, faCircle }  from '@fortawesome/free-solid-svg-icons'

export const Category = ({title, editCategory, deleteCategory}) => {
    return (
            <div className="Category">
                    {/* <div className="title-wrapper">  */}
                    {/* <FontAwesomeIcon icon={faCircle} className="circle-icon"/> */}
                    <p>{title.title}</p>
                    <div>
                        <button type="button">
                            <FontAwesomeIcon icon={faPen} />
                            onClick={() => editCategory(title.id)}
                        </button>
                        <button type="button">
                            <FontAwesomeIcon icon={faTrashCan} />
                            onClick={() => deleteCategory(title.id)} 
                        </button>  
                    </div>                  
            </div>
    )
}
